       <button className="bg-slate-500 rounded-lg p-2 m-1"> Followin</button>
       <button className="bg-slate-500 rounded-lg p-2 m-1"> Message</button>
       <button className="bg-slate-500 rounded-lg p-2 m-1">Icon</button>
       </div>
        
      </div>
    </div>
  );
};
